import { useState } from "react";
import "./addtodiv.css";
export default function AddDivisions() {
    window.document.body.style.backgroundColor = "white";



    const [divisionscount,setDivisionscount]=useState(0);
    console.log(divisionscount);
    const adddivisons=async(c)=>{
        setDivisionscount(c);
    }
    const handleSubmit=async(e)=>{
        e.preventDefault();

    }

    return (
        <>

            <div className="container addtodiv my-5">
                <form className="container formaddtodiv col-4" onSubmit={(e)=>handleSubmit(e)}>
                    <label htmlFor="NumberofDivisions" className="form-label">Number of Divisions</label>
                    <div className="mb-3 d-flex">
                        <input type="number"  className="form-control mx-3" id="NumberofDivisions" onChange={(e)=>setDivisionscount(e.target.value)} />
                        <button type="submit" className="btn btn-primary" >Confirm</button>
                    </div>
                </form>
                {
                    divisionscount !==null
                    (
            <div>{divisionscount}</div>
          )
                
                }
            </div>
        </>
    )
}
